ひとつは通常の形式で、以下のような形である。 NodeName attr1, attr2, attr3, ... { ; ここに子ノード
} 子ノードは適宜タブ文字などでインデントされているが、これが必要なものかは不明。 この形式は、属性を1つも持たないか、または子ノードを1つ以上持つようなノードで利用される。 属性を持たない場合、以下のようになる。 NodeName { ; ここに子ノード
} FBX SDK から出力されたデータでは、ノード名と { の間に空白文字が2つ入っている。 これが読み込みでも2つである必要があるかは不明。 子ノードを持たない場合、以下のような形になる。 NodeName attr1, attr2, attr3, ... {
} { と } の間に改行が必ず入る。

