FBX テキスト形式でバイナリデータを保持する必要のある場面は極めて限定的である。 バイナリしか持たない FileId のようなノードはそもそもテキスト形式では存在しないし、テクスチャ等の埋め込みはそもそもテキスト形式では不可能である。 ユーザ定義のプロパティとしてバイナリを与えたとき、バイナリデータは 配列 と類似した、擬似的なノード風の構文で表現される。 P: "MyBlob", "Blob", "", "U",8 { BinaryData: "cG95b3BveW8="
} データ部は base64 でエンコードされた文字列である。 62 と 63 用の記号としては + と / が用いられる。 文字列が長すぎる場合、 base64 エンコード後の文字列で4の倍数文字ごとに分割が行われる。 以下は分割の例である。 (通常4文字毎での分割は行われず、3584文字などそこそこ長い単位で分割される。) P: "MyBlob", "Blob", "", "U",8 { BinaryData: "cG95", "b3Bv", "eW8="
} 分割後の2行目以降の各行先頭に空白文字がひとつ入っている。 これが必要かは不明。 分割されていた場合、最終行末尾のコンマが許されるかは不明。
